import React from 'react';
import './App.css';
import Login from './Login'; // A importação que queremos testar

// Linhas de diagnóstico:
// Vamos imprimir no console para ver o que chegou aqui.
console.log("Importado como Login:", Login);
console.log("Tipo do 'Login' importado:", typeof Login);

function App() {
  // Adicionamos uma verificação de segurança
  if (!Login) {
    return <h1>ERRO: O componente Login não foi carregado corretamente! Verifique o console.</h1>;
  }

  return (
    <div className="App">
      <Login />
    </div>
  );
}

export default App;
